import { useEffect } from "react";  //obtener el parámetro de ID de la URL.
import { useParams } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import { getByDetail } from "../../redux/actions";


const { id } = useParams();
const dispatch = useDispatch();


const dogDetail = useSelector((state) => state.dogDetail);
useEffect(() => {
    dispatch(getByDetail(id));
  }, [dispatch, id]);


const Detail = ()=>{
    return (
        <div>
          <h1>{dogDetail.name}</h1>
          <img src={dogDetail.image} alt={dogDetail.name} />
          <p>Temperament: {dogDetail.temperament}</p>
          <p>Weight: {dogDetail.weight}</p>
          <p>Height: {dogDetail.height}</p>
          <p>Life Span: {dogDetail.life_span}</p>
        </div>
      );

}


export default Detail
